import React from "react";
import SvgIcon from '@mui/material/SvgIcon';
import HotPeppericon from '../../images/googlemap.svg';

export function GoogleIcon (props) {
  return (
    <SvgIcon
      component="span"
      >
      <svg width="100" height="100" fill="none" xmlns={HotPeppericon} ><circle cx="50" cy="50" r="40" stroke="#000" stroke-width="3" fill="red"/></svg>
    </SvgIcon>
  );
};
